import React, {Component,Fragment,Container,Row,Col} from 'react';

class Services extends Component{
	render(){
		return (
			<Fragment>
				<Container>
					<Row>
						<Col>
							<p>Emon</p>
						</Col>
						<Col>
							<p>Emon 2</p>
						</Col>
						<Col>
							<p>Emon 3</p>
						</Col>
					</Row>
				</Container>
			</Fragment>
		);
	}
}

export default Services;
